        @wraps(func)
        def wrapper(symbol):
            if symbol in cache and time.time() - cache[symbol]['timestamp'] < timeout:
                return cache[symbol]['result']
            else:
                result = func(symbol)
                cache[symbol] = {'result': result, 'timestamp': time.time()}
                return result
        return wrapper
    return decorator

