def parse_name(name):
    parts = name.rsplit(' ', 1)
    if len(parts) == 1:
        return {"full_name": name}
    elif len(parts) == 2:
        first, last = parts
        return {"first": first, "last": last}
    else:
        first, *middle, last = parts
        return {"first": first, "middle": " ".join(middle), "last": last}

